import React, { FC, useState } from 'react';
import { Form, Input } from 'antd';

export const LoginForm: FC = () => {
  const [form] = Form.useForm();

  return (
    <Form form={form}>
      <Form.Item
        label={'User-ID'}
        name='user-id'
        required>
        <Input />
      </Form.Item>
      <Form.Item
        label={'Password'}
        name='password'
        required>
        <Input />
      </Form.Item>
    </Form>
  );
};
